import './App.css';
import Header from "./Header";
import Stories from "./Stories"
import danki_bg from "./resources/danki_bg.jpg"
function App() {
  return (
    <div className="App">
      <Header/>
      <Stories />
      <div className = "feedForm">
        <img src={danki_bg} />
        <input type= "text" />
      </div>
    </div>
  );
}

export default App;
